const Home = ({ posts }) => {
  return (
    <main className='Home'>
        {posts.length ? (
          <Feed posts={ posts }/>
        ) : (
          <p style={{marginTop: "2rem"}}>Nothing to Display</p>
        ) }
    </main>
  )
}

export default Home
